        <script>
            const spanElements = document.querySelectorAll(".inside-circle span");
            const circleElements = document.querySelectorAll("#actualCircle");

            function updateStrokeDashArray() {
                spanElements.forEach((spanElement, index) => {
                    const number = parseInt(spanElement.innerText);
                    const circumference =
                        Math.PI * (circleElements[index].getAttribute("r") * 2);
                    const dashArray =
                        (number / 1400) * circumference + " " + circumference;
                    circleElements[index].setAttribute("stroke-dasharray", dashArray);
                });
            }
            updateStrokeDashArray();
            spanElements.forEach((spanElement) => {
                spanElement.addEventListener(
                    "DOMSubtreeModified",
                    updateStrokeDashArray
                );
            });

            var states = [
                "UZB354",
                "UZB355",
                "UZB356",
                "UZB357",
                "UZB358",
                "UZB361",
                "UZB362",
                "UZB363",
                "UZB364",
                "UZB365",
                "UZB370",
                "UZB371",
                "UZB372",
                "UZB374",
            ];

            states.forEach(function(state) {
                var infoBox = document.querySelector("#info-" + state);
                if (infoBox) {
                    var percentage = parseFloat(infoBox.querySelector("span").innerText);
                    var path = document.querySelector(".sm_state_" + state);
                    if (path) {
                        if (percentage > 50) {
                            path.style.fill = "#26282B";
                            infoBox.querySelector("span").style.backgroundColor = "#26282B";
                            infoBox.querySelector("span").style.color = "#fff";
                        } else if (percentage > 10) {
                            path.style.fill = "#0D63A5";
                            infoBox.querySelector("span").style.backgroundColor = "#0D63A5";
                            infoBox.querySelector("span").style.color = "#fff";
                        }
                    }
                }
            });
        </script>
    </body>


